import React from 'react';

function Algorithm() {
    return(
        <section>
            <div class="container-fluid">
                <h1 class="mt-5">Welcome</h1>
                <p>This is going to be my algorithms page.</p>
            </div>
        </section>
    );
}

export default Algorithm;
